function Journies() {
  return (
    <div style={{paddingTop: '10vh', backgroundClip: 'content-box', width: '70vw', height: '70vh', backgroundColor: 'rgb(10,10,10)'}}>
      <Session/>
      <Session/>
      <Session/>
      <Session/>
      <Session/>
    </div>
  )
}

const sessions = [
  {result: 143, stakes: '$1/$3', loc: 'MGM', dur: '4.5 hrs'},
  {result: 31, stakes: '$1/$3', loc: 'MGM', dur: '4.5 hrs'},
  {result: -486, stakes: '$1/$3', loc: 'MGM', dur: '4.5 hrs'}
]

function Session() {
  return (<div style={{height: '25px', paddingLeft: '20px', display: 'flex', gap: '8px'}}>
    <p style={{color: 'rgb(0,192,0)'}}>+ $143</p>
    <p style={{color: 'rgb(40,40,40)'}}>&mdash;</p>
    <p style={{color: 'rgb(190,190,190)'}}>$1/$3 @ MGM</p>
    <p style={{color: 'rgb(40,40,40)'}}>&mdash;</p>
    <p style={{color: 'rgb(190,190,190)'}}>4.5 hrs</p>
  </div>)
}

export { Journies }
